"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[8575],{8575:e=>{e.exports=JSON.parse('{"ai21":{"description":"AI21 Labs entwickelt Basis-Modelle und KI-Systeme f\xfcr Unternehmen und beschleunigt die Anwendung generativer KI in der Produktion."},"ai302":{"description":"302.AI ist eine On-Demand-KI-Anwendungsplattform, die die umfassendsten KI-APIs und KI-Online-Anwendungen auf dem Markt bietet"},"ai360":{"description":"360 AI ist die von der 360 Company eingef\xfchrte Plattform f\xfcr KI-Modelle und -Dienste, die eine Vielzahl fortschrittlicher Modelle zur Verarbeitung nat\xfcrlicher Sprache anbietet, darunter 360GPT2 Pro, 360GPT Pro, 360GPT Turbo und 360GPT Turbo Responsibility 8K. Diese Modelle kombinieren gro\xdfe Parameter mit multimodalen F\xe4higkeiten und finden breite Anwendung in den Bereichen Textgenerierung, semantisches Verst\xe4ndnis, Dialogsysteme und Codegenerierung. Durch flexible Preisstrategien erf\xfcllt 360 AI die vielf\xe4ltigen Bed\xfcrfnisse der Nutzer, unterst\xfctzt Entwickler bei der Integration und f\xf6rdert die Innovation und Entwicklung intelligenter Anwendungen."},"aihubmix":{"description":"AiHubMix bietet \xfcber eine einheitliche API-Schnittstelle Zugriff auf verschiedene KI-Modelle."},"akashchat":{"description":"Akash ist ein genehmigungsfreier Cloud-Ressourcenmarkt, dessen Preisgestaltung im Vergleich zu herk\xf6mmlichen Cloud-Anbietern wettbewerbsf\xe4hig ist."},"anthropic":{"description":"Anthropic ist ein Unternehmen, das sich auf Forschung und Entwicklung im Bereich der k\xfcnstlichen Intelligenz spezialisiert hat und eine Reihe fortschrittlicher Sprachmodelle anbietet, darunter Claude 3.5 Sonnet, Claude 3 Sonnet, Claude 3 Opus und Claude 3 Haiku. Diese Modelle erreichen ein ideales Gleichgewicht zwischen Intelligenz, Geschwindigkeit und Kosten und sind f\xfcr eine Vielzahl von Anwendungsszenarien geeignet, von unternehmensweiten Arbeitslasten bis hin zu schnellen Reaktionen. Claude 3.5 Sonnet, als neuestes Modell, hat in mehreren Bewertungen hervorragend abgeschnitten und bietet gleichzeitig ein hohes Preis-Leistungs-Verh\xe4ltnis."},"azure":{"description":"Azure bietet eine Vielzahl fortschrittlicher KI-Modelle, darunter GPT-3.5 und die neueste GPT-4-Serie, die verschiedene Datentypen und komplexe Aufgaben unterst\xfctzen und sich auf sichere, zuverl\xe4ssige und nachhaltige KI-L\xf6sungen konzentrieren."},"azureai":{"description":"Azure bietet eine Vielzahl fortschrittlicher KI-Modelle, darunter GPT-3.5 und die neueste GPT-4-Serie, die verschiedene Datentypen und komplexe Aufgaben unterst\xfctzen und sich auf sichere, zuverl\xe4ssige und nachhaltige KI-L\xf6sungen konzentrieren."},"baichuan":{"description":"Baichuan Intelligent ist ein Unternehmen, das sich auf die Forschung und Entwicklung gro\xdfer KI-Modelle spezialisiert hat. Ihre Modelle zeigen hervorragende Leistungen in chinesischen Aufgaben wie Wissensdatenbanken, Verarbeitung langer Texte und kreative Generierung und \xfcbertreffen die g\xe4ngigen Modelle im Ausland. Baichuan Intelligent verf\xfcgt auch \xfcber branchenf\xfchrende multimodale F\xe4higkeiten und hat in mehreren renommierten Bewertungen hervorragend abgeschnitten. Ihre Modelle umfassen Baichuan 4, Baichuan 3 Turbo und Baichuan 3 Turbo 128k, die jeweils f\xfcr unterschiedliche Anwendungsszenarien optimiert sind und kosteneffiziente L\xf6sungen bieten."},"bedrock":{"description":"Bedrock ist ein Service von Amazon AWS, der sich darauf konzentriert, Unternehmen fortschrittliche KI-Sprach- und visuelle Modelle bereitzustellen. Die Modellfamilie umfasst die Claude-Serie von Anthropic, die Llama 3.1-Serie von Meta und mehr, und bietet eine Vielzahl von Optionen von leichtgewichtig bis hochleistungsf\xe4hig, die Textgenerierung, Dialoge, Bildverarbeitung und andere Aufgaben unterst\xfctzen und f\xfcr Unternehmensanwendungen unterschiedlicher Gr\xf6\xdfen und Anforderungen geeignet sind."},"bfl":{"description":"Ein f\xfchrendes, hochmodernes Forschungslabor f\xfcr k\xfcnstliche Intelligenz, das die visuelle Infrastruktur von morgen aufbaut."},"cerebras":{"description":"Cerebras ist eine KI-Inferenzplattform, die auf dem spezialisierten CS-3-System basiert. Sie wurde entwickelt, um weltweit die schnellsten, in Echtzeit reagierenden und hochdurchsatzf\xe4higen LLM-Dienste bereitzustellen. Ziel ist es, Latenzen zu eliminieren und komplexe KI-Workflows wie die Echtzeit-Codegenerierung und Agentenaufgaben zu beschleunigen."},"cloudflare":{"description":"F\xfchren Sie von serverlosen GPUs betriebene Machine-Learning-Modelle im globalen Netzwerk von Cloudflare aus."},"cohere":{"description":"Cohere bringt Ihnen die fortschrittlichsten mehrsprachigen Modelle, leistungsstarke Suchfunktionen und einen ma\xdfgeschneiderten KI-Arbeitsbereich f\xfcr moderne Unternehmen – alles integriert in einer sicheren Plattform."},"cometapi":{"description":"CometAPI ist eine Serviceplattform, die verschiedene fortschrittliche Schnittstellen f\xfcr gro\xdfe Modelle anbietet und OpenAI, Anthropic, Google und weitere unterst\xfctzt. Sie eignet sich f\xfcr vielf\xe4ltige Entwicklungs- und Anwendungsanforderungen. Nutzer k\xf6nnen je nach Bedarf das optimale Modell und den besten Preis flexibel ausw\xe4hlen, um das KI-Erlebnis zu verbessern."},"comfyui":{"description":"Leistungsstarke Open-Source-Engine f\xfcr die Erstellung von Bildern, Videos und Audiodateien. Unterst\xfctzt fortschrittliche Modelle wie SD, FLUX, Qwen, Hunyuan und WAN. Bietet eine node-basierte Workflow-Bearbeitung sowie M\xf6glichkeiten zur privaten Bereitstellung."},"deepseek":{"description":"DeepSeek ist ein Unternehmen, das sich auf die Forschung und Anwendung von KI-Technologien spezialisiert hat. Ihr neuestes Modell, DeepSeek-V2.5, kombiniert allgemeine Dialog- und Codeverarbeitungsf\xe4higkeiten und hat signifikante Fortschritte in den Bereichen menschliche Pr\xe4ferenzanpassung, Schreibaufgaben und Befehlsbefolgung erzielt."},"fal":{"description":"Generative Medienplattform f\xfcr Entwickler"},"fireworksai":{"description":"Fireworks AI ist ein f\xfchrender Anbieter von fortschrittlichen Sprachmodellen, der sich auf Funktionsaufrufe und multimodale Verarbeitung spezialisiert hat. Ihr neuestes Modell, Firefunction V2, basiert auf Llama-3 und ist f\xfcr Funktionsaufrufe, Dialoge und Befehlsbefolgung optimiert. Das visuelle Sprachmodell FireLLaVA-13B unterst\xfctzt gemischte Eingaben von Bildern und Text. Weitere bemerkenswerte Modelle sind die Llama-Serie und die Mixtral-Serie, die effiziente mehrsprachige Befehlsbefolgung und Generierungsunterst\xfctzung bieten."},"giteeai":{"description":"Die serverlose API von Gitee AI bietet KI-Entwicklern einen sofort einsatzbereiten gro\xdfen Modell-Inferenz-API-Service."},"github":{"description":"Mit GitHub-Modellen k\xf6nnen Entwickler zu KI-Ingenieuren werden und mit den f\xfchrenden KI-Modellen der Branche arbeiten."},"google":{"description":"Die Gemini-Serie von Google ist ihr fortschrittlichstes, universelles KI-Modell, das von Google DeepMind entwickelt wurde und speziell f\xfcr multimodale Anwendungen konzipiert ist. Es unterst\xfctzt nahtlose Verst\xe4ndnis- und Verarbeitungsprozesse f\xfcr Text, Code, Bilder, Audio und Video. Es ist f\xfcr eine Vielzahl von Umgebungen geeignet, von Rechenzentren bis hin zu mobilen Ger\xe4ten, und verbessert erheblich die Effizienz und Anwendbarkeit von KI-Modellen."},"groq":{"description":"Der LPU-Inferenz-Engine von Groq hat in den neuesten unabh\xe4ngigen Benchmark-Tests f\xfcr gro\xdfe Sprachmodelle (LLM) hervorragende Leistungen gezeigt und definiert mit seiner erstaunlichen Geschwindigkeit und Effizienz die Standards f\xfcr KI-L\xf6sungen neu. Groq ist ein Beispiel f\xfcr sofortige Inferenzgeschwindigkeit und zeigt in cloudbasierten Bereitstellungen eine gute Leistung."},"higress":{"description":"Higress ist ein cloud-natives API-Gateway, das intern bei Alibaba entwickelt wurde, um die Probleme von Tengine Reload bei langanhaltenden Verbindungen zu l\xf6sen und die unzureichenden Lastverteilungsm\xf6glichkeiten von gRPC/Dubbo zu verbessern."},"huggingface":{"description":"Die HuggingFace Inference API bietet eine schnelle und kostenlose M\xf6glichkeit, Tausende von Modellen f\xfcr verschiedene Aufgaben zu erkunden. Egal, ob Sie Prototypen f\xfcr neue Anwendungen erstellen oder die Funktionen des maschinellen Lernens ausprobieren, diese API erm\xf6glicht Ihnen den sofortigen Zugriff auf leistungsstarke Modelle aus verschiedenen Bereichen."},"hunyuan":{"description":"Ein von Tencent entwickeltes gro\xdfes Sprachmodell, das \xfcber starke F\xe4higkeiten zur Erstellung von Inhalten in chinesischer Sprache, logisches Denkverm\xf6gen in komplexen Kontexten und zuverl\xe4ssige F\xe4higkeiten zur Aufgabenerf\xfcllung verf\xfcgt."},"infiniai":{"description":"Bietet Anwendungsentwicklern hochleistungs-f\xe4hige, benutzerfreundliche und sichere Dienste f\xfcr gro\xdfe Modelle, die den gesamten Prozess von der Entwicklung gro\xdfer Modelle bis hin zur Dienstbereitstellung abdecken."},"internlm":{"description":"Eine Open-Source-Organisation, die sich der Forschung und Entwicklung von gro\xdfen Modellen und Werkzeugketten widmet. Sie bietet allen KI-Entwicklern eine effiziente und benutzerfreundliche Open-Source-Plattform, die den Zugang zu den neuesten Technologien und Algorithmen f\xfcr gro\xdfe Modelle erm\xf6glicht."},"jina":{"description":"Jina AI wurde 2020 gegr\xfcndet und ist ein f\xfchrendes Unternehmen im Bereich Such-KI. Unsere Suchplattform umfasst Vektormodelle, Re-Ranker und kleine Sprachmodelle, die Unternehmen dabei helfen, zuverl\xe4ssige und qualitativ hochwertige generative KI- und multimodale Suchanwendungen zu entwickeln."},"lmstudio":{"description":"LM Studio ist eine Desktop-Anwendung zum Entwickeln und Experimentieren mit LLMs auf Ihrem Computer."},"minimax":{"description":"MiniMax ist ein im Jahr 2021 gegr\xfcndetes Unternehmen f\xfcr allgemeine k\xfcnstliche Intelligenz, das sich der gemeinsamen Schaffung von Intelligenz mit den Nutzern widmet. MiniMax hat verschiedene multimodale allgemeine gro\xdfe Modelle entwickelt, darunter ein Textmodell mit Billionen von Parametern, ein Sprachmodell und ein Bildmodell. Au\xdferdem wurden Anwendungen wie Conch AI eingef\xfchrt."},"mistral":{"description":"Mistral bietet fortschrittliche allgemeine, spezialisierte und forschungsorientierte Modelle an, die in Bereichen wie komplexe Schlussfolgerungen, mehrsprachige Aufgaben und Code-Generierung weit verbreitet sind. Durch Funktionsaufrufschnittstellen k\xf6nnen Benutzer benutzerdefinierte Funktionen integrieren und spezifische Anwendungen realisieren."},"modelscope":{"description":"ModelScope ist eine von Alibaba Cloud eingef\xfchrte Plattform f\xfcr Modelle als Dienstleistung, die eine Vielzahl von KI-Modellen und Inferenzdiensten anbietet."},"moonshot":{"description":"Moonshot ist eine Open-Source-Plattform, die von Beijing Dark Side Technology Co., Ltd. eingef\xfchrt wurde und eine Vielzahl von Modellen zur Verarbeitung nat\xfcrlicher Sprache anbietet, die in vielen Bereichen Anwendung finden, darunter, aber nicht beschr\xe4nkt auf, Inhaltserstellung, akademische Forschung, intelligente Empfehlungen und medizinische Diagnosen, und unterst\xfctzt die Verarbeitung langer Texte und komplexer Generierungsaufgaben."},"nebius":{"description":"Nebius bietet globalen KI-Innovatoren durch den Aufbau gro\xdffl\xe4chiger GPU-Cluster und einer vertikal integrierten Cloud-Plattform leistungsstarke Infrastruktur."},"newapi":{"description":"Open-Source-Plattform zur einheitlichen Weiterleitung mehrerer KI-Dienste"},"novita":{"description":"Novita AI ist eine Plattform, die eine Vielzahl von gro\xdfen Sprachmodellen und API-Diensten f\xfcr die KI-Bilderzeugung anbietet, die flexibel, zuverl\xe4ssig und kosteneffektiv ist. Sie unterst\xfctzt die neuesten Open-Source-Modelle wie Llama3 und Mistral und bietet umfassende, benutzerfreundliche und automatisch skalierbare API-L\xf6sungen f\xfcr die Entwicklung generativer KI-Anwendungen, die f\xfcr das schnelle Wachstum von KI-Startups geeignet sind."},"nvidia":{"description":"NVIDIA NIM™ bietet Container f\xfcr selbstgehostete, GPU-beschleunigte Inferenz-Mikrodienste, die die Bereitstellung von vortrainierten und benutzerdefinierten KI-Modellen in der Cloud, in Rechenzentren, auf RTX™ AI-PCs und Workstations unterst\xfctzen."},"ollama":{"description":"Die von Ollama angebotenen Modelle decken ein breites Spektrum ab, darunter Code-Generierung, mathematische Berechnungen, mehrsprachige Verarbeitung und dialogbasierte Interaktionen, und unterst\xfctzen die vielf\xe4ltigen Anforderungen an unternehmensgerechte und lokal angepasste Bereitstellungen."},"ollamacloud":{"description":"Ollama Cloud bietet offiziell gehostete Inferenzdienste, mit sofortigem Zugriff auf die Ollama-Modellbibliothek und Unterst\xfctzung f\xfcr OpenAI-kompatible Schnittstellen."},"openai":{"description":"OpenAI ist eine weltweit f\xfchrende Forschungsinstitution im Bereich der k\xfcnstlichen Intelligenz, deren entwickelte Modelle wie die GPT-Serie die Grenzen der Verarbeitung nat\xfcrlicher Sprache vorantreiben. OpenAI setzt sich daf\xfcr ein, durch innovative und effiziente KI-L\xf6sungen verschiedene Branchen zu transformieren. Ihre Produkte zeichnen sich durch herausragende Leistung und Wirtschaftlichkeit aus und finden breite Anwendung in Forschung, Wirtschaft und innovativen Anwendungen."},"openrouter":{"description":"OpenRouter ist eine Serviceplattform, die eine Vielzahl von Schnittstellen f\xfcr fortschrittliche gro\xdfe Modelle anbietet und OpenAI, Anthropic, LLaMA und mehr unterst\xfctzt, um vielf\xe4ltige Entwicklungs- und Anwendungsbed\xfcrfnisse zu erf\xfcllen. Benutzer k\xf6nnen je nach ihren Anforderungen flexibel das optimale Modell und den Preis ausw\xe4hlen, um das KI-Erlebnis zu verbessern."},"perplexity":{"description":"Perplexity ist ein f\xfchrender Anbieter von Dialoggenerierungsmodellen und bietet eine Vielzahl fortschrittlicher Llama 3.1-Modelle an, die sowohl f\xfcr Online- als auch Offline-Anwendungen geeignet sind und sich besonders f\xfcr komplexe Aufgaben der Verarbeitung nat\xfcrlicher Sprache eignen."},"ppio":{"description":"PPIO Paiou Cloud bietet stabile und kosteneffiziente Open-Source-Modell-API-Dienste und unterst\xfctzt die gesamte DeepSeek-Serie, Llama, Qwen und andere f\xfchrende gro\xdfe Modelle der Branche."},"qiniu":{"description":"Qiniu ist ein f\xfchrender Anbieter von Cloud-Diensten, der schnelle und effiziente API-Dienste f\xfcr gro\xdfe Modelle bereitstellt, einschlie\xdflich der von Alibaba, mit flexiblen Optionen f\xfcr das Entwickeln und Anwenden von AI-Anwendungen."},"qwen":{"description":"Tongyi Qianwen ist ein von Alibaba Cloud selbst entwickeltes, gro\xdf angelegtes Sprachmodell mit starken F\xe4higkeiten zur Verarbeitung und Generierung nat\xfcrlicher Sprache. Es kann eine Vielzahl von Fragen beantworten, Texte erstellen, Meinungen \xe4u\xdfern und Code schreiben und spielt in mehreren Bereichen eine Rolle."},"sambanova":{"description":"SambaNova Cloud erm\xf6glicht es Entwicklern, die besten Open-Source-Modelle einfach zu nutzen und von der schnellsten Inferenzgeschwindigkeit zu profitieren."},"search1api":{"description":"Search1API bietet Zugriff auf die DeepSeek-Modellreihe, die bei Bedarf selbstst\xe4ndig online gehen kann, einschlie\xdflich der Standard- und Schnellversion, und unterst\xfctzt die Auswahl von Modellen in verschiedenen Parametergr\xf6\xdfen."},"sensenova":{"description":"SenseTime bietet mit der starken Basisunterst\xfctzung von SenseTimes gro\xdfem Ger\xe4t effiziente und benutzerfreundliche Full-Stack-Modelldienste."},"siliconcloud":{"description":"SiliconFlow hat sich zum Ziel gesetzt, AGI zu beschleunigen, um der Menschheit zu dienen, und die Effizienz gro\xdfangelegter KI durch eine benutzerfreundliche und kosteng\xfcnstige GenAI-Stack zu steigern."},"spark":{"description":"Der Xinghuo-Gro\xdfmodell von iFLYTEK bietet leistungsstarke KI-F\xe4higkeiten in mehreren Bereichen und Sprachen und nutzt fortschrittliche Technologien zur Verarbeitung nat\xfcrlicher Sprache, um innovative Anwendungen f\xfcr intelligente Hardware, intelligente Medizin, intelligente Finanzen und andere vertikale Szenarien zu entwickeln."},"stepfun":{"description":"Das StepFun-Gro\xdfmodell verf\xfcgt \xfcber branchenf\xfchrende multimodale und komplexe Schlussfolgerungsf\xe4higkeiten und unterst\xfctzt das Verst\xe4ndnis von sehr langen Texten sowie leistungsstarke, autonome Suchmaschinenfunktionen."},"taichu":{"description":"Das Institut f\xfcr Automatisierung der Chinesischen Akademie der Wissenschaften und das Wuhan Institute of Artificial Intelligence haben ein neues Generation multimodales gro\xdfes Modell eingef\xfchrt, das umfassende Frage-Antwort-Aufgaben unterst\xfctzt, darunter mehrstufige Fragen, Textgenerierung, Bildgenerierung, 3D-Verst\xe4ndnis und Signalverarbeitung, mit st\xe4rkeren kognitiven, verstehenden und kreativen F\xe4higkeiten, die ein neues interaktives Erlebnis bieten."},"tencentcloud":{"description":"Die atomare F\xe4higkeit der Wissensmaschine (LLM Knowledge Engine Atomic Power) basiert auf der Entwicklung der Wissensmaschine und bietet eine umfassende F\xe4higkeit zur Wissensabfrage f\xfcr Unternehmen und Entwickler. Sie k\xf6nnen mit verschiedenen atomaren F\xe4higkeiten Ihren eigenen Modellservice erstellen und Dokumentenanalysen, -aufteilungen, Embeddings, mehrfache Umformulierungen und andere Dienste kombinieren, um ma\xdfgeschneiderte KI-L\xf6sungen f\xfcr Ihr Unternehmen zu entwickeln."},"togetherai":{"description":"Together AI strebt an, durch innovative KI-Modelle f\xfchrende Leistungen zu erzielen und bietet umfangreiche Anpassungsm\xf6glichkeiten, einschlie\xdflich schneller Skalierungsunterst\xfctzung und intuitiver Bereitstellungsprozesse, um den unterschiedlichen Anforderungen von Unternehmen gerecht zu werden."},"upstage":{"description":"Upstage konzentriert sich auf die Entwicklung von KI-Modellen f\xfcr verschiedene gesch\xe4ftliche Anforderungen, einschlie\xdflich Solar LLM und Dokumenten-KI, mit dem Ziel, k\xfcnstliche allgemeine Intelligenz (AGI) zu erreichen. Es erm\xf6glicht die Erstellung einfacher Dialogagenten \xfcber die Chat-API und unterst\xfctzt Funktionsaufrufe, \xdcbersetzungen, Einbettungen und spezifische Anwendungsbereiche."},"v0":{"description":"v0 ist ein Pair-Programming-Assistent, bei dem Sie Ihre Ideen einfach in nat\xfcrlicher Sprache beschreiben k\xf6nnen, und er generiert Code und Benutzeroberfl\xe4chen (UI) f\xfcr Ihr Projekt."},"vercelaigateway":{"description":"Vercel AI Gateway bietet eine einheitliche API zum Zugriff auf \xfcber 100 Modelle und erm\xf6glicht die Nutzung von Modellen verschiedener Anbieter wie OpenAI, Anthropic und Google \xfcber einen einzigen Endpunkt. Unterst\xfctzt Budgeteinstellungen, Nutzungs\xfcberwachung, Lastenausgleich und Failover."},"vertexai":{"description":"Die Gemini-Serie von Google ist das fortschrittlichste, universelle KI-Modell, das von Google DeepMind entwickelt wurde. Es ist speziell f\xfcr multimodale Anwendungen konzipiert und unterst\xfctzt das nahtlose Verst\xe4ndnis und die Verarbeitung von Text, Code, Bildern, Audio und Video. Es eignet sich f\xfcr eine Vielzahl von Umgebungen, von Rechenzentren bis hin zu mobilen Ger\xe4ten, und verbessert erheblich die Effizienz und Anwendbarkeit von KI-Modellen."},"vllm":{"description":"vLLM ist eine schnelle und benutzerfreundliche Bibliothek f\xfcr LLM-Inferenz und -Dienste."},"volcengine":{"description":"Die von ByteDance eingef\xfchrte Entwicklungsplattform f\xfcr gro\xdfe Modellservices bietet funktionsreiche, sichere und preislich wettbewerbsf\xe4hige Modellaufrufdienste. Sie bietet zudem End-to-End-Funktionen wie Moduldaten, Feinabstimmung, Inferenz und Bewertung, um die Entwicklung Ihrer KI-Anwendungen umfassend zu unterst\xfctzen."},"wenxin":{"description":"Eine unternehmensweite, umfassende Plattform f\xfcr die Entwicklung und den Service von gro\xdfen Modellen und KI-nativen Anwendungen, die die vollst\xe4ndigsten und benutzerfreundlichsten Werkzeuge f\xfcr die Entwicklung generativer KI-Modelle und den gesamten Anwendungsentwicklungsprozess bietet."},"xai":{"description":"xAI ist ein Unternehmen, das sich der Entwicklung von K\xfcnstlicher Intelligenz widmet, um menschliche wissenschaftliche Entdeckungen zu beschleunigen. Unsere Mission ist es, unser gemeinsames Verst\xe4ndnis des Universums voranzutreiben."},"xinference":{"description":"Xorbits Inference (Xinference) ist eine Open-Source-Plattform zur Vereinfachung der Ausf\xfchrung und Integration verschiedener KI-Modelle. Mit Xinference k\xf6nnen Sie beliebige Open-Source-LLMs, Embedding-Modelle und multimodale Modelle in der Cloud oder lokal ausf\xfchren, um leistungsstarke KI-Anwendungen zu erstellen."},"zeroone":{"description":"01.AI konzentriert sich auf die k\xfcnstliche Intelligenz-Technologie der AI 2.0-\xc4ra und f\xf6rdert aktiv die Innovation und Anwendung von \'Mensch + k\xfcnstliche Intelligenz\', indem sie leistungsstarke Modelle und fortschrittliche KI-Technologien einsetzt, um die Produktivit\xe4t der Menschen zu steigern und technologische Bef\xe4higung zu erreichen."},"zhipu":{"description":"Zhipu AI bietet eine offene Plattform f\xfcr multimodale und Sprachmodelle, die eine breite Palette von KI-Anwendungsszenarien unterst\xfctzt, darunter Textverarbeitung, Bildverst\xe4ndnis und Programmierhilfe."}}')}}]);